return (function (stabilityLength, maxTime, done) {
      try {
        const start = Date.now()
        let lastActivity = start
        // how long do we need to see inactivity to think all tags fired
        const timeoutInMillseconds = stabilityLength || 2000
        const MutationObserver = window.MutationObserver || window.WebKitMutationObserver

        if (MutationObserver) {
          var mutationObserver = new MutationObserver(function () {
            lastActivity = Date.now()
          })

          var inactivityInterval = window.setInterval(function () {
            const currentTime = Date.now()
            const currentInactivity = currentTime - lastActivity
            const totalTime = currentTime - start
            if (currentInactivity >= timeoutInMillseconds || totalTime >= maxTime) {
              mutationObserver.disconnect()
              window.clearInterval(inactivityInterval)
              done((currentTime - start) / 1000)
            }
          }, 200) // polling frequency

          mutationObserver.observe(document.body, {
            childList: true,
            subtree: true
          })

          mutationObserver.observe(document.head, {
            childList: true,
            subtree: true
          })
        } else {
          const currentTime = Date.now()
          window.setTimeout(function () { done((currentTime - start) / 1000) }, maxTime / 2) // use half of the maxTime as a fallback for older browsers
        }
      } catch (e) {
        done(e)
      }
    }).apply(null, arguments)

